import React, { Component } from 'react'

export class count extends Component {
    constructor(props){
        super(props)
        this.state = {
            count:0
        }
    }

    increment() {
        this.setState({
            count : this.state.count + 1
        })
        
    }
    
    render() {
        return (
            <div>
                <button onClick={() => this.increment()}></button>{this.state.count}
            </div>
        )
    }
}

export default count
